import React from "react";
import { NavLink } from "react-router-dom";

function Home() {
  return (
    <div className=" flex flex-col items-center w-full">
      <div className=" w-full  w-[80vw] pl-32 mt-11 h-auto">
        <div>
          <button
            to={"/"}
            className=" bg-green-700 w-[7vw] h-[3vw]  rounded-md"
          >
            Anasayfa
          </button>
          <button
            to={"/addwords"}
            className=" bg-green-700 w-[7vw] h-[3vw] ml-3  rounded-md"
          >
            Kelime Ekle
          </button>
          <button
            to={"/words"}
            className=" bg-green-700 w-[7vw] h-[3vw] ml-3 rounded-md"
          >
            Kelimeler
          </button>
        </div>
        <div className=" w-full h-auto mt-14 ml-10 gap-5">
          <h3>KELİME</h3>
          <p>Türkçesi nedir ?</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
